import { RdsChipComponent } from './chip/chip.component';
export type RdsChipsSize = 's' | 'm' | 'l';
export type RdsChipType = 'blue' | 'neutral';
export type RdsChipCompareFunction<K, T = K> = (valueOne: K, valueTwo: T) => boolean;
export interface RdsChipsDefaultOptions {
    separatorKeys: readonly string[];
}
export interface RdsChipEvent<T> {
    readonly source: RdsChipComponent<T>;
}
export interface RdsChipEditedEvent<T> extends RdsChipEvent<T> {
    value: string;
}
export interface RdsChipSelectEvent<T> {
    readonly source: RdsChipComponent<T>;
    readonly selected: boolean;
    readonly isUserInput: boolean;
}
